First, let's import necessary libraries:

```python
import numpy as np
import random
```

Next, define functions to generate random data for each feature based on their univariate statistics:

```python
def generate_target_thickness():
    return np.random.uniform(loc=0, high=125)

def generate_pulse_width():
    return np.random.lognormal(loc=np.log(30), scl=np.sqrt(169))

def generate_energy():
    lower, upper = 0.3, 1000
    if random.uniform(0, 1) < 0.5:
        return np.random.uniform(loc=lower, high=upper)
    else:
        return np.random.exponential(scale=2.35)

def generate_spot_size():
    return np.random.uniform(loc=2.13, high=60)

def generate_intensity():
    return np.random.exponential(scale=np.exp(np.log(6.19e20) / 2)) ** 2

def generate_power():
    intensity = generate_intensity()
    energy = generate_energy()
    return intensity * energy

def generate_cutoff_energy():
    return np.random.uniform(loc=3.3, high=95)

def generate_target_material():
    materials = ['plastic', 'aluminium', 'polypropylene', 'polystyrene', 'gold']
    return random.choice(materials)
```

Now let's create an empty list to store 25 data points:

```python
