    # Check if target thickness is within the given range
    if not 0 < target_thickness <= 125:
        return False

    # Check if pulse width is positive and has a reasonable variance
    if pulse_width > 0 and np.abs(np.log(pulse_width) - np.log(30)) < np.sqrt(169):
        pass
    else:
        return False

    # Check if energy is within the given range
    if not (0.3 <= energy <= 1000):
        return False

    # Check if spot size is within the given range
    if not (2.13 <= spot_size <= 60):
        return False

    # Check if intensity and power are positive and have a reasonable variance
    if intensity > 0 and np.abs(np.log10(intensity) - np.log10(5.10e20)) < np.sqrt(np.log(3.96e41)):
        if power > 0:
            pass
        else:
            return False
    else:
        return False

    # Check if cutoff energy is within the given range
    if not (3.3 <= cutoff_energy <= 95):
        return False

    return True
```

Now we can evaluate each data point and improve it recursively:

```python
